import React from "react";

const DisplayExperience = (props) => {
  const { experienceArray } = props;

  return (
    <div>
      {experienceArray.map((arr) => {
        return (
          <div>
            <div>{arr.company}</div>
            <div>{arr.city}</div>
            <div>{arr.from}</div>
            <div>{arr.to}</div>
            <div>{arr.role}</div>
            <div>{arr.role}</div>
          </div>
        );
      })}
    </div>
  );
};

export default DisplayExperience;
